import React from 'react';

const Task = (task:any) => {

	return (
		<li className="list-item">
			<span>{task.title}</span>
			<div>
				
				<button className="btn-edit task-btn">
					<i className="fas fa-pen"></i>
				</button>
				<button className="btn-delete task-btn">
					<i className="fas fa-trash-alt"></i>
				</button>

			</div>
		</li>
	);
};

export default Task;
